package com.yappy.trnxd.backend.transaction.junior.controller;import com.yappy.trnxd.backend.transaction.junior.command.CommonCommand;import com.yappy.trnxd.backend.transaction.junior.model.RequestDTO;import com.yappy.trnxd.backend.transaction.junior.model.ResponseDTO;import com.yappy.trnxd.backend.transaction.junior.model.TransactionRequestDTO;import com.yappy.trnxd.backend.transaction.junior.model.TransactionResponseDTO;import lombok.extern.slf4j.Slf4j;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.beans.factory.annotation.Qualifier;import org.springframework.http.MediaType;import org.springframework.web.bind.annotation.PostMapping;import org.springframework.web.bind.annotation.RequestBody;import org.springframework.web.bind.annotation.RequestMapping;import org.springframework.web.bind.annotation.RestController;@Slf4j@RestController@RequestMapping("/api/v1/transaction")public class TransactionController {    @Autowired    @Qualifier("transactionCommand")    protected CommonCommand<RequestDTO<TransactionRequestDTO>, ResponseDTO<TransactionResponseDTO>> transactionCommand;    @PostMapping(path = "/send", produces = MediaType.APPLICATION_JSON_VALUE)    public ResponseDTO<TransactionResponseDTO> sendTransaction(@RequestBody RequestDTO<TransactionRequestDTO> request) {        log.info(request.toString());        return transactionCommand.execute(request);    }}